import React, { Component, useState } from 'react';
import Nav from '../Nav/Nav';
import ResultDisplay from '../ResultDisplay/ResultDisplay';
import Footer from '../Footer/Footer';
import ResultsTitle from '../ResultsTitle/ResultsTitle';
import {Group, Person} from '../../groupClass.js';


function ResultsPage() {
    let TempGroupObject = new Group();
    const [aGroupObject, setGroupObject] = useState(TempGroupObject);


    console.log(this.state.TempGroupObject);



    return (
        <div className="page-wrapper">
          <header>
            <Nav />
            <ResultsTitle title={this.state.TempGroupObject.projectName}/>
          </header>
          <main id="entry-container">
            <ResultDisplay />
          </main>
            <Footer
              value="Save"
              text="Save"
              onClick={this.saveProject}/>
        </div>
    );
  }
export default ResultsPage;


